import Slot from "../slots/slot"

class BassDrum extends React.Component {
  render() {
    const num = [1, 2]
    return (
      <div className="slotRow">
        {num.map((cartItem) => (
          <Slot key={cartItem} item={cartItem} />
        ))}
      </div>
    )
  }
}

export default BassDrum
